// SPDX-Licence-Identifier: UNLICENSED
pragma solidity ^0.7.0;

contract FileStorage
{
    string public name = 'FileStorage';
    mapping (uint => File) public files;
    uint public fileCount=0;
    
    
    struct File
    {
        uint fileId;
        string fileHash;
        uint fileSize;
        string fileType;
        string fileName;
        string fileDescription;
        uint uploadTime;
        address payable uploader;
    }
    
    event FileUploaded(
        uint fileId,
        string fileHash,
        uint fileSize,
        string fileType,
        string fileName,
        string fileDescription,
        uint uploadTime,
        address payable uploader
        );
    
    constructor()
    {
        
    }
    
    function uploadFile(string memory _fileHash,uint _fileSize,string memory _fileType,string memory _fileName,string memory _fileDescription) public
    {
        //to check whether fileHash exist
        require(bytes(_fileHash).length>0);
        
        //to check whether fileType exist
        require(bytes(_fileType).length>0);
        
        //to check whether fileDescription exist
        require(bytes(_fileDescription).length>0);
        
        //to check whether fileName exist
        require(bytes(_fileName).length>0);
        
        //to check uploader address exist
        require(msg.sender!=address(0));
        
        //to check filesize is more than 0
        require(_fileSize>0);        
        
        fileCount++;
        files[fileCount] = File(fileCount,_fileHash,_fileSize,_fileType,_fileName,_fileDescription,block.timestamp,msg.sender); //block.timestamp will store time file was uploaded. msg.sender will give the address of the person calling this 
        
        //trigger the event
        emit FileUploaded(fileCount,_fileHash,_fileSize,_fileType,_fileName,_fileDescription,block.timestamp,msg.sender);
    }
}
